import React, { Component } from "react";
import { MDBContainer, MDBMask, MDBView } from "mdbreact";
import FooterPage from "./footer.js";

class main extends Component {
  render() {
    return (
      <div>
        <MDBView src="">
            <MDBMask type="video/mp4" src = "http://www.sample-videos.com/video/mp4/720/big_buck_bunny_720p_1mb.mp4"overlay="purple-light" className="flex-center flex-column text-white text-center">
            </MDBMask>
            </MDBView>
        <main>
          <MDBContainer className="text-center my-5"></MDBContainer>
        </main>
        <FooterPage />
      </div>
    );
  }
}

export default main;
<video id="background-video" loop autoPlay>
